import { userService } from "../utils/services";
import { actionsConstant } from '../Constants/actions.Constant'
export const userActions = {
  login,
  logout,
  register
};

function login(email, password) {
  return dispatch => {
    dispatch(request(email));
    userService.login(email, password).then(
      user => {
        dispatch({ type: actionsConstant.LOGIN_SUCCESS, user });
      }, 
      error => {
        dispatch({ type: actionsConstant.LOGIN_FAILURE, error });
      }
    );
  };
   function request(email) { return { type: actionsConstant.LOGIN_REQUEST, email }}
}

function logout(email, password) {
  userService.logout();
  return { type: "LOGOUT" };
}

function register(username, password) {}
